Wardrobe essentials - Little Black Dress 🖤 As they say you can never go wrong in lbd! 👠Works like wonder 🤯🤩 Hope this video helps you style better,follow for more such videos! 

Look 1 - Add a sleeveless high/turtle neck, tie sleeves around your neck. This look works like a body shaper and accentuate your curves. 

Look 2- wear your sleeves like one shoulder dress, tying sleeves together at shoulder. Don’t forget to accessories 

Look 3 - lbd isn’t just for party take a subtle blouse/ top, do the top hack as shown and pair with brown for a semi-formal look. 

Look 4 - Add a blazer/jacket with a belt on waist and a classy sling and stilettos! Ready like a boss babe 

Look 5 - add a sleevless bright color top and mismatch with your accessories to create color block and fun vibes, good to go for your casual dayout! Don’t forget your cap!

Look 6/7 - Tying hacks for lbd, for the effortless chic look. Tie around your neck or in center as a knotted top! Add a neckpiece and minimal earring 

Look 8- A whole new vibe to lbd from classic to bohemian! Add a printed palazzo, add a shrug,few jewellery with comfy footwear and a sling! 

